      {/* Title */}
      <h1 style={styles.title}>
        <span role="img" aria-label="Medical analysis">üìã</span> Tableau de Bord - Pharmacien
      </h1>
      <p style={styles.subtitle}>
        Bienvenue, voici vos outils principaux pour l'analyse clinique :
