      {/* Content */}
      <div style={styles.content}>
        <div style={styles.card}>
          <h2>Analyse Clinique</h2>
          <p>Consultez les donn√©es cliniques et les r√©sultats d'essais.</p>
          <Link to="/clinical-analysis" style={styles.link}>
            Acc√©der √† l'analyse clinique
